import React from 'react';
import ReactDOM from 'react-dom';

let Greeting = (props) => <div>
                              User name: {props.name},
                              Last name: {props.lastName},
                              Age: {props.age}
                          </div>;
ReactDOM.render(
          <Greeting name="Adilet" lastName="Mom" age="{32}"/>,
          document.getElementById('root')
          );
